import styled from "styled-components";

const SignOutButton = styled.button`
  background-color: transparent;
  height: 3em;
  width: 6em;
  background-color: #c23616;
  border: none;
  color: #2f3640;
  border-radius: 4px;
`;

export default SignOutButton;
